import React, { useState } from 'react';
import Navbar from '../Components/Navbar';
import BottomHeader from '../Components/BottomHeader';

function DataPage() {

    return (
        <div className="flex flex-col w-full h-screen items-center custom-background-img-mobile sm:custom-background-img-desktop">
            <Navbar />
            <div className="flex flex-col h-max w-full items-center overflow-y-auto gap-2 pt-8">
                <h2 className="text-2xl text-bold">Training Data</h2>
                <iframe src="https://drive.google.com/file/d/1ZOvHeQpRFOZz689fKGWIfavA5dwOo9ke/preview" title="PDF-Viewer" width="1000" height="650" allow="autoplay"/>
            </div>
            <BottomHeader />
        </div>
    );
}

export default DataPage;
